import React from "react";
import "./Banner.css";

function Banner() {
  return (
    <div className="banner">
      <div
        style={{
          display: "flex",
          justifyContent: "space-evenly",
          width: "50%",
          textAlign: "center",
        }}
      >
        <p>Best Sellers</p>
        <p>Gift Ideas</p>
        <p>New Releases</p>
        <p>Today's Deals</p>
        <p>Customer Service</p>
      </div>
    </div>
  );
}

export default Banner;
